import { type } from "os";
import React, {FC} from "react";

interface FiletrButtonProps {
    value: string;
    onClick?: any;
}


const FilterButton: FC<FiletrButtonProps> = ({ value, onClick}) => {
    return (
        <button value={value} onChange = {event => onClick()}>
        </button>
    )
}

export default FilterButton;
